package com.incidences.incidencesapp;

import androidx.test.ext.junit.runners.AndroidJUnit4;

import com.incidences.incidencesapp.models.IncidencesEntity;
import com.incidences.incidencesapp.models.IncidencesModel;

import org.junit.Before;
import org.junit.Test;
import org.junit.runner.RunWith;

import java.util.ArrayList;

import static org.junit.Assert.assertEquals;

@RunWith(AndroidJUnit4.class)
public class IncidencesModelTest {

    private IncidencesModel incidencesModel;
    private IncidencesEntity incidencesEntity;
    private String id;

    @Before
    public void setUp() {
        incidencesModel = new IncidencesModel();
        incidencesEntity = new IncidencesEntity();
        incidencesEntity.setId("123123123");
        incidencesEntity.setPhone("123456789");
        incidencesEntity.setImage("");
        incidencesEntity.setName("This is a name incidence");
        incidencesEntity.setDescription("this is a description test");
        incidencesEntity.setSeverity("moderate");
        incidencesEntity.setDate("21/11/2020");
        incidencesEntity.setResolved(false);
        incidencesEntity.setSite("this is a test site in my street");
        incidencesModel.insert(incidencesEntity);
        this.id = this.incidencesModel.getAllSummarize().get(0).getId();
    }

    @Test
    public void insertIncidences() {
        assertEquals(true, this.incidencesModel.insert(this.incidencesEntity));
    }

    @Test
    public void getIncidenceId() {
        assertEquals(this.id, this.incidencesModel.getItemById(this.id).getId());
        assertEquals(this.incidencesEntity.getDate(), this.incidencesModel.getItemById(this.id).getDate());
    }

    @Test
    public void getAllIncidences() {
        assertEquals(this.id, this.incidencesModel.getAllSummarize().get(0).getId());
    }

    @Test
    public void updateIncidences() {
        this.incidencesEntity.setResolved(false);
        this.incidencesEntity.setPhone("123987652");
        assertEquals(true, this.incidencesModel.update(this.incidencesEntity));
    }


    @Test
    public void getAllSeveritiesIncidence() {
        ArrayList<String> severities = new ArrayList<>();
        severities.add("moderate");
        assertEquals(severities, this.incidencesModel.getSeverities());
    }

    @Test
    public void deleteIncidence() {
        assertEquals(true, this.incidencesModel.delete(incidencesEntity));
    }

    @Test
    public void getIncidenceBySearch() {
        assertEquals(this.incidencesEntity.getName(), this.incidencesModel.getItemsByAllCriterias("moderate", "21/11/2020", "This is a name incidence").get(0).getName());
        assertEquals(this.incidencesEntity.getName(), this.incidencesModel.getItemsByDate("21/11/2020").get(0).getName());
        assertEquals(this.incidencesEntity.getName(), this.incidencesModel.getItemsByName("This is a name incidence").get(0).getName());
        assertEquals(this.incidencesEntity.getName(), this.incidencesModel.getItemsBySeverity("moderate").get(0).getName());
        assertEquals(0, this.incidencesModel.getItemsByAllCriterias("low", "21/11/2020", "This is a name incidence").size());
        assertEquals(0, this.incidencesModel.getItemsByAllCriterias("moderate", "21/11/1998", "This is a name incidence").size());

    }
}
